import React, { useRef } from 'react';
import './App.css';

function App() {
  const pageRef = useRef(null);

  const scrollToPage = (pageId) => {
    const page = document.getElementById(pageId);
    if (pageRef.current && page) {
      pageRef.current.scrollTo({
        left: page.offsetLeft,
        behavior: 'smooth',
      });
    }
  };

  const playSound = (sound) => {
    const audioPath = `./sounds/${sound}.mp3`;
    console.log('Audio Path:', audioPath);
    const audio = new Audio(audioPath);
    audio.play();
  };

  return (
    <div className="App">
      <div className="page-container" ref={pageRef}>
        <div className="page home" id="home">
          <h1>Home Page</h1>
          <div className="sound-tiles">
            <div className="tile" onClick={() => playSound('Fan')}>Fan</div>
            <div className="tile" onClick={() => playSound('Cat')}>Cat</div>
            <div className="tile" onClick={() => playSound('Clock')}>Clock</div>
            <div className="tile" onClick={() => playSound('Television')}>Television</div>
            <div className="tile" onClick={() => playSound('AC')}>AC</div>
          </div>
        </div>

        <div className="page forest" id="forest">
          <h1>Forest Page</h1>
          <div className="sound-tiles">
            <div className="tile" onClick={() => playSound('Rain')}>Rain</div>
            <div className="tile" onClick={() => playSound('Thunder')}>Thunder</div>
            <div className="tile" onClick={() => playSound('Birds')}>Birds</div>
            <div className="tile" onClick={() => playSound('River')}>River</div>
            <div className="tile" onClick={() => playSound('Wind')}>Wind</div>
          </div>
        </div>

        <div className="page beach" id="beach">
          <h1>Beach Page</h1>
          <div className="sound-tiles">
            <div className="tile" onClick={() => playSound('Waves')}>Waves</div>
            <div className="tile" onClick={() => playSound('Seagulls')}>Seagulls</div>
            <div className="tile" onClick={() => playSound('Boat')}>Boat</div>
            <div className="tile" onClick={() => playSound('Campfire')}>Campfire</div>
            <div className="tile" onClick={() => playSound('Melody')}>Melody</div>
          </div>
        </div>

        <div className="page urban" id="urban">
          <h1>Urban Page</h1>
          <div className="sound-tiles">
            <div className="tile" onClick={() => playSound('People')}>People</div>
            <div className="tile" onClick={() => playSound('Traffic')}>Traffic</div>
            <div className="tile" onClick={() => playSound('Pigeons')}>Pigeons</div>
            <div className="tile" onClick={() => playSound('Truck')}>Truck</div>
            <div className="tile" onClick={() => playSound('Train')}>Train</div>
          </div>
        </div>
      </div>

      <div className="nav-links bottom">
        <button onClick={() => scrollToPage('forest')}>Forest</button>
        <button onClick={() => scrollToPage('beach')}>Beach</button>
        <button onClick={() => scrollToPage('urban')}>Urban</button>
        <button onClick={() => scrollToPage('home')}>Home</button>
      </div>
    </div>
  );
}

export default App;
